"use strict";(self.webpackChunkiuvc_template=self.webpackChunkiuvc_template||[]).push([[393],{9393:function(a,e,s){s.r(e),s.d(e,{default:function(){return v}});const t=(0,s(6252).uE)('<div class="lf-resume_title" data-v-e712235e><div class="title" data-v-e712235e>求职简历</div><div class="desc" data-v-e712235e><p data-v-e712235e>PERSONAL RESUME</p><p data-v-e712235e>一直在努力！</p></div></div><div class="lf-resume_content" data-v-e712235e><div class="content-title" data-v-e712235e><span class="name" data-v-e712235e>基本信息</span><div class="line" data-v-e712235e></div><div class="lf-community_link" data-v-e712235e><a href="https://github.com/iuvc/magicJs/issues" target="_blank" data-v-e712235e><i class="iconfont ify-self-github" data-v-e712235e></i></a><a href="https://blog.csdn.net/weixin_42927679?type=blog" target="_blank" data-v-e712235e><i class="iconfont ify-self-csdn" data-v-e712235e></i></a></div></div><div class="content-wrapper base-info" data-v-e712235e><div class="info-item" data-v-e712235e><div data-v-e712235e><span class="label" data-v-e712235e>姓      名</span>： <span class="value" data-v-e712235e>刘兴锋</span></div><div data-v-e712235e><span class="label" data-v-e712235e>出生年月</span>： <span class="value" data-v-e712235e>1997-02-02</span></div><div data-v-e712235e><span class="label" data-v-e712235e>开发经验</span>： <span class="value" data-v-e712235e>5年</span></div><div data-v-e712235e><span class="label" data-v-e712235e>求职意向</span>： <span class="value" data-v-e712235e>前端开发工程师</span></div></div><div class="info-item" data-v-e712235e><div data-v-e712235e><span class="label" data-v-e712235e>手      机</span>： <span class="value" data-v-e712235e>18397879024</span></div><div data-v-e712235e><span class="label" data-v-e712235e>邮      箱</span>： <span class="value" data-v-e712235e>18397879024@163.com</span></div><div data-v-e712235e><span class="label" data-v-e712235e>籍      贯</span>： <span class="value" data-v-e712235e>江西</span></div><div data-v-e712235e><span class="label" data-v-e712235e>专      业</span>： <span class="value" data-v-e712235e>软件工程</span></div></div><div class="personal" data-v-e712235e></div></div><div class="content-title" data-v-e712235e><span class="name" data-v-e712235e>专业技能</span><div class="line" data-v-e712235e></div></div><div class="content-wrapper" data-v-e712235e><pre data-v-e712235e>具有五年 Web/H5 开发经验，Js 基础扎实，熟悉 TS ，Sass 语法。\n熟悉前端项目框架搭建流程，常用组件封装，业务代码抽离，代码书写规范。\n熟练掌握 Vue2/Vue3 相关技术栈及 Element-UI 等组件库，并在实际项目中运用。\n熟悉 V8 垃圾回收机制，能使用浏览器开发者工具进行项目性能分析、调试、项目性能优化。\n了解 NodeJs、Python 等编程语言。</pre></div><div class="content-title" data-v-e712235e><span class="name" data-v-e712235e>工作经历</span><div class="line" data-v-e712235e></div></div><div class="content-wrapper ent-info" data-v-e712235e><div class="ent-item" data-v-e712235e><div class="ent-name" data-v-e712235e><i class="horn" data-v-e712235e></i><span class="name" data-v-e712235e>杭州炬华科技股份有限公司</span><span class="time" data-v-e712235e>2018-12 - 2023-07</span><span class="post" data-v-e712235e>前端开发工程师</span></div>\x3c!-- &lt;div class=&quot;job-content&quot;&gt;\n          &lt;p&gt;工作职责：&lt;/p&gt;\n          &lt;pre&gt;1.主导公司项目前端框架搭建和技术选型，以提高项目开发效率和性能。\n2.规范化全局常量和样式的定义，通用组件和方法的抽离封装，确保代码易于维护和扩展。\n3.负责日常维护公司各项目，日常需求开发和解决项目难题，并协助同事解决遇到的技术问题。\n4.管理前端事务的安排和跟进，以确保项目按时高质量完成。&lt;/pre&gt;\n        &lt;/div&gt; --\x3e</div><div class="ent-item" data-v-e712235e><div class="ent-name" data-v-e712235e><i class="horn" data-v-e712235e></i><span class="name" data-v-e712235e>杭州玖迈网络科技有限公司</span><span class="time" data-v-e712235e>2018-06 - 2018-11</span><span class="post" data-v-e712235e>前端开发工程师</span></div>\x3c!-- &lt;div class=&quot;job-content&quot;&gt;\n          &lt;p&gt;工作职责：&lt;/p&gt;\n          &lt;pre&gt;1.负责公司现有项目日常维护与优化工作，确保项目持续稳定运行，并不断改进用户体验和性能表现。\n2.参与项目需求分析和流程设计，为项目提供相关技术支持和优化建议，确保项目在初期规划阶段就具备一定可行性和可拓展性。\n3.协同后台开发和 UI 设计人员，紧密合作完成数据交互和动态信息展现的实现，以提供流畅且富有交互性的用户界面。\n&lt;/pre&gt;\n        &lt;/div&gt; --\x3e</div></div><div class="content-title" data-v-e712235e><span class="name" data-v-e712235e>项目经验</span><div class="line" data-v-e712235e></div></div><div class="content-wrapper ent-info project" data-v-e712235e><div class="ent-item" data-v-e712235e><div class="ent-name" data-v-e712235e><i class="horn" data-v-e712235e></i><span class="name" data-v-e712235e>纳宇云能源物联网信息平台 </span><span class="time" data-v-e712235e></span><a href="https://www.sunriseyny.cn/ems-web" class="post" data-v-e712235e>https://www.sunriseyny.cn/ems-web</a></div><div class="job-content" data-v-e712235e><div class="item" data-v-e712235e><span data-v-e712235e>项目描述：</span><span data-v-e712235e> 炬华科技是一家专业从事能源物联网设备和服务研发、生产与销售的高新技术企业。该平台是一款基于B/S框架搭建的能源物联网信息平台，集成了多项功能模块，如 MQTT 设备通讯、设备 SVG 图形化、设备实时预警与告警、Echart可视化、大屏展示、视频监控、百度地图等。</span></div><div class="item" data-v-e712235e><span data-v-e712235e>技术栈：</span> <span data-v-e712235e>Vue全家桶、Element-UI、Echarts、MQTT、BMap、Aliplayer、3D GIS。</span></div><div class="item" data-v-e712235e><span data-v-e712235e>主要负责：</span> <span data-v-e712235e>1. 前端框架搭建及技术选型，封装常用的组件和方法，方便后续开发人员使用。<br data-v-e712235e> 2. 性能优化：利用浏览器缓存，减少HTTP请求，压缩图像大小，优化冗余代码，界面首屏展示速度由20多秒提升至数秒级。<br data-v-e712235e> 3. 优化波点图展示，采用时间切片思想，处理数十万，乃至上百万条数据，解决因数据量过大导致界面卡顿，提升图形渲染速度90%。<br data-v-e712235e> 4. H5公众号/App 开发：为居民用户提供水电费查询、催费通知、充值缴费等服务。以服务商身份，接入微信支付，支付宝支付，并提供App推送和公众号推送。</span></div></div></div><div class="ent-item" data-v-e712235e><div class="ent-name" data-v-e712235e><i class="horn" data-v-e712235e></i><span class="name" data-v-e712235e>集中器配置软件 - 嵌入式web</span><span class="time" data-v-e712235e></span><span class="post" data-v-e712235e></span></div><div class="job-content" data-v-e712235e><div class="item" data-v-e712235e><span data-v-e712235e>项目描述：</span> <span data-v-e712235e>该项目是一个基于 JS 原生 + jQuery + Echarts 技术的海外集中器配置软件。涵盖多语言翻译功能，后端使用了 C 语言编写的公共网关接口 CGI 脚本。前端主要功能分为运行状态，设备管理，参数设置三大模块。集中器运维管理人员可通过软件查看集中器、主站、各项接入设备的状态和数据信息，还可进行任务下发和和设备软件升级，配置相关 IP 连接和系统命令执行。该软件在吉尔吉斯斯坦、埃及和南非等海外地区成功落地，为公司开拓海外业务做出了重要贡献。</span></div><div class="item" data-v-e712235e><span data-v-e712235e>技术栈：</span> <span data-v-e712235e>Ajax、JQuery.js、Echarts。</span></div><div class="item" data-v-e712235e><span data-v-e712235e>主要负责：</span> <span data-v-e712235e>1. 公共常量定义，通用方法封装和公共样式定义。<br data-v-e712235e> 2. 使用 onstorage 和 postMessage 事件监听在不同窗口和标签页之间进行信息传递，确保良好的交互体验。<br data-v-e712235e> 3. 模仿 Element-ui 组件，使用原生 Js 封装 Message 和 Loading 等通用组件。</span></div></div></div><div class="ent-item" data-v-e712235e><div class="ent-name" data-v-e712235e><i class="horn" data-v-e712235e></i><span class="name" data-v-e712235e>智慧充电互联网云服务平台</span><span class="time" data-v-e712235e></span><a href="https://charging.sunriseyny.cn/charging-web" class="post" data-v-e712235e>https://charging.sunriseyny.cn/charging-web</a></div><div class="job-content" data-v-e712235e><div class="item" data-v-e712235e><span data-v-e712235e>项目描述：</span> <span data-v-e712235e>智慧充电互联网云服务平台采用私营+合作的模式，提供企业用户或私家车主通过App/公众号进行扫码充电服务。主要功能有:充电设施查找，充值服务，⻋牌号管理，优惠券及发票管理。</span></div><div class="item" data-v-e712235e><span data-v-e712235e>技术栈：</span> <span data-v-e712235e>Vue全家桶、Element-UI、Echarts、MQTT、BMap。</span></div><div class="item" data-v-e712235e><span data-v-e712235e>主要负责：</span> <span data-v-e712235e>1. 采用面向对象编程思想，设计并优化公众号扫码充电流程。<br data-v-e712235e> 2. 结合BMap，腾讯地图相关Api，实现充电桩的位置导航，路线规划，地图定位和充电桩信息展示。<br data-v-e712235e> 3. 解决微信公众号上线后 localStorage 缓存数据被不定时清除的缺陷，登录信息由前端存储改为前后端共同存储。</span></div></div></div></div><div class="content-title" data-v-e712235e><span class="name" data-v-e712235e>教育背景</span><div class="line" data-v-e712235e></div></div><div class="content-wrapper edu-info" data-v-e712235e><div class="edu-item" data-v-e712235e><span data-v-e712235e>2021-03 - 2023-06</span><span data-v-e712235e>杭州电子科技大学</span><span data-v-e712235e>软件工程</span></div><div class="edu-item" data-v-e712235e><span data-v-e712235e>2015-09 - 2018-06</span><span data-v-e712235e>九江职业技术学院</span><span data-v-e712235e>计算机信息管理</span></div></div><div class="content-title" data-v-e712235e><span class="name" data-v-e712235e>自我评价</span><div class="line" data-v-e712235e></div></div><div class="content-wrapper" data-v-e712235e> 有较强的自主学习能力，接受能力强，喜欢新知识。<br data-v-e712235e>有良好的编码习惯，代码风格良好可维护。<br data-v-e712235e>做事踏实，有耐心，比较稳定。 <br data-v-e712235e>适应力强，能很快的融入新环境. </div>\x3c!-- &lt;div class=&quot;content-title&quot;&gt;\n      &lt;span class=&quot;name&quot;&gt;擅长软件&lt;/span&gt;\n      &lt;div class=&quot;line&quot;&gt;&lt;/div&gt;\n    &lt;/div&gt;\n    &lt;div class=&quot;content-wrapper tools&quot;&gt;\n      Visual Studio Code，HBuilderX，Notepad++，Chorme，Firefox，Postman，微信开发者工具\n    &lt;/div&gt; --\x3e</div>',2);var d={mounted(){document.title="刘兴锋-前端开发工程师-五年前端开发经验"}};var v=(0,s(3744).Z)(d,[["render",function(a,e,s,d,v,n){return t}],["__scopeId","data-v-e712235e"]])}}]);